import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios';

const Navbar = () => {
  const [isAuthenticated, setIsAuthenticated] = useState(false);
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [message, setMessage] = useState('');
  const [username, setUsername] = useState('');

  useEffect(() => {
    // Check if user is logged in when the component mounts
    axios.get('http://localhost:3001/profile', { withCredentials: true })
      .then((response) => {
        setIsAuthenticated(true);
        setUsername(response.data.name);
      })
      .catch(() => {
        setIsAuthenticated(false);
      });
  }, []);

  const handleLogin = async (e) => {
    e.preventDefault();
    try {
      const res = await axios.post('http://localhost:3001/login', { email, password }, { withCredentials: true });
      setMessage(res.data.msg);
      setIsAuthenticated(true);
      setUsername(res.data.user.name);
    } catch (error) {
      setMessage('Login failed');
      console.error(error);
    }
  };

  const handleLogout = async () => {
    try {
      const res = await axios.post('http://localhost:3001/logout', {}, { withCredentials: true });
      setMessage(res.data.msg);
      setIsAuthenticated(false);
      setUsername('');
    } catch (error) {
      setMessage('Logout failed');
      console.error(error);
    }
  };

  return (
    <nav className='navbar'>
      <Link to='/'>
        <img src="/images/logo.png" alt="Logo" className="logo" />
      </Link>

      <div className='navbar-links'>
        <div className='nav-item dropdown'>
          <p className='dropdown-title'>World Wide Tournaments</p>
          <div className='dropdown-menu'>
            <Link to="/league-of-legends" className='dropdown-item'>
              League of Legends
            </Link>
            <Link to="/valorant" className='dropdown-item'>
              Valorant
            </Link>
            <Link to="/overwatch2" className='dropdown-item'>
              Overwatch 2
            </Link>
          </div>
        </div>

        <Link to="/guideslist" className='nav-item'>
          <p>Guides</p>
        </Link>
        <div className='nav-item'>
          <p>Forum</p>
        </div>
        <div className='nav-item'>
          <p>Gift Codes</p>
        </div>
        <Link to="/contact" className='nav-item'>
          <p>Contact</p>
        </Link>
      </div>

      <div className="auth-buttons">
        {isAuthenticated ? (
          <div className='welcome-user'>
            <p>Welcome, {username}!</p>
            <button className='btn logout-btn' onClick={handleLogout}>Logout</button>
          </div>
        ) : (
          <form onSubmit={handleLogin} className='login-form'>
            <input
              type="email"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              placeholder="Enter email"
              required
              className='login-input'
            />
            <input
              type="password"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              placeholder="Enter password"
              required
              className='login-input'
            />
            <button type="submit" className='btn login-btn'>Login</button>
          </form>
        )}
      </div>

      {message && <p style={{ color: 'yellow', marginTop: '10px' }}>{message}</p>}
    </nav>
  );
};

export default Navbar;
